import React, {Component} from 'react';
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';
//import "boostrap/dist/css/boostrap.min.css";
import connect from 'react-redux';

import Home from './components/Home';
import NewsById from './components/news/NewsById';
import NewsInCate from './components/category/NewsInCate';

import './App.css';
import Axios from 'axios';

export default class App  extends Component {
    componentDidMount(){
        const onLoad = this.props;

        axios('http://localhost:4000/category')
            .then((res) =>onLoad(res.data))
    }
    render(){
      return(
        <Router>

          <nav class="navbar navbar-expand-lg navbar-dark bg-dark fixed-top">
                <div class="container">
                    <a class="navbar-brand" href="#">News </a>
                    <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarResponsive" aria-controls="navbarResponsive" aria-expanded="false" aria-label="Toggle navigation">
                        <span class="navbar-toggler-icon"></span>
                    </button>
                    <div class="collapse navbar-collapse" id="navbarResponsive">
                <ul class="navbar-nav ml-auto">
                    <li class="nav-item active">
                        <a class="nav-link" href="#">Business
                        <span class="sr-only">(current)</span>
                        </a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link" href="#">Technology</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link" href="#">Entertainment</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link" href="#">Ideas</a>
                     </li>
                     <li class="nav-item">
                        <a class="nav-link" href="#">Science</a>
                     </li>
                </ul>
            </div>
        </div>
    </nav>
            <Route path="/" exact component={Home}></Route>
            <Route path="/category/:id/post/:id" component={NewsById}></Route>
            <Route path="/category/:id/posts" component={NewsInCate}></Route>
        </Router>
      );
    }
}
